import Foundation

func measureTime(for closure: @autoclosure () -> Any) {
    let start = CFAbsoluteTimeGetCurrent()
    closure()
    let diff = CFAbsoluteTimeGetCurrent() - start
    print("Took \(diff) seconds")
}

func minWindow(_ s: String, _ t: String) -> String {
    if s.count < t.count {
        return ""
    }

    let sMap:[Character] = Array(s)
    var needDic:[Character:Int] = [:]
    var minCount:Int = Int.max
    var minStart:Int = 0

    for c in s {
        needDic[c] = 0
    }

    for c in t {
        needDic[c,default: 0] += 1
    }

    var start:Int = 0
    var end:Int = 0
    var need:Int = t.count

    while end < sMap.count {
        let key = sMap[end]
        if needDic[key]! > 0 {
            need -= 1
        }

        needDic[key]! -= 1

        while need == 0 {
            if minCount > end - start + 1 {
                minCount = end - start + 1
                minStart = start
            }

            let key = sMap[start]
            if needDic[key]! >= 0 {
                need += 1
            }
            needDic[key]! += 1
            start += 1
        }
        
        end += 1
    }

    return minCount != Int.max ? String(sMap[minStart..<minStart + minCount]) : ""
}




